import { CartesianGrid, LineChart, ResponsiveContainer, Tooltip, XAxis, YAxis, Line } from "recharts";

function RackCurrentGraph({data, type}){
    const chartData = data.map(d => ({
        time: d.datetime
    }))
    return(
        <div style={{width: "100%", height: 260}}>
            <ResponsiveContainer>
                <LineChart data={data}>
                    <CartesianGrid strokeDasharray="3 3"/>

                    <XAxis
                        dataKey="datetime"
                        tick={{fontSize: 11}}
                        interval={3}
                    />
                    <YAxis
                        unit="A"
                        tick={{fontSize: 11}}
                    />

                    <Tooltip
                        formatter={(value) => [`${value} A`, "電流値"]}
                    />

                    <Line
                        type="monotone"
                        dataKey="current"
                        stroke="orange"
                        strokeWidth={2}
                        dot={false}
                    />
                </LineChart>
            </ResponsiveContainer>
        </div>
    )
}

export default RackCurrentGraph;
